create table invitations
(
    id              int unsigned auto_increment comment '邀请码ID'
        primary key,
    invitation_code varchar(16)                        not null comment '邀请码',
    user_id         varchar(255)                       not null comment '归属者用户ID',
    created_at      datetime default CURRENT_TIMESTAMP not null,
    updated_at      datetime                           null,
    deleted_at      datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index invitations_invitation_code_index
    on invitations (invitation_code);

create index invitations_user_id_index
    on invitations (user_id);

